import React from "react";

const Collect = () => {
  return (
    <div className="Collect">
      <div className="print"></div>
      <div className="text1">Please collect your receipt.</div>
      <div className="text2">issue it at the counter to get your SAVINGS</div>
    </div>
  );
};

export default Collect;
